import React from 'react';
import { Box, Typography } from '@mui/material';

const PortfolioTitle = () => {
  return (
    <Box sx={{ textAlign: 'center', backgroundColor: '#007F8D', py: 2 }}>
      <Typography variant="h2" component="h2" sx={{ color: '#fff', fontFamily: 'Roboto', fontWeight: 700 }}>
        <Box sx={{ display: 'flex', alignItems: 'center' }}>
          <img src="profile.jpeg" alt="Mi foto de perfil" width="150" height="200" sx={{ borderRadius: '50%', marginRight: 1 }} />
          <Typography variant="h6" component="div" sx={{ color: '#000' }}>
            Ramiro Slullitel
          </Typography>
        </Box>
        Bienvenidos a mi portfolio web
      </Typography>
    </Box>
  );
};

export default PortfolioTitle;
